void roll(double *state_hist, double *new_state)
{
    double tmp[input_dim*state_window];
    for (int i = 0; i < input_dim*state_window; i++)
        tmp[i] = state_hist[i];
    for (int i = input_dim; i < input_dim*state_window; i++)
        state_hist[i-input_dim] = tmp[i];
    for (int i = 0; i < input_dim; i++)
        state_hist[input_dim*state_window - input_dim + i] = new_state[i];
}



void mat_vec_mult(const double *mat1, const double *vec, double *output, const int M, const int N)
{
    /**
     * @brief Matrix multiplication of mat1 MxN with vector N resulting in vector M
     * pointer notation A[i, j] with N columns is accesed as A[i*N + j]
     */
    int i,j, row;
    double sum_;
    for (i = 0; i < M; i++)
    {
        sum_ = 0.0;
        row = i*N;
        for (j = 0; j < N; j++)
            sum_ += mat1[row + j] * vec[j];
        output[i] = sum_;
    }
}

void _vec_addition(double *vec1, const double *vec2, const int size)
{
    /**
     * @brief In place element-wise addition between vectors
     *
     */
    int i;
    for (i = 0; i < size; i++)
        vec1[i] += vec2[i];
}

double dot(const double *mat1, const double *vec, const int N)
{
    /**
     * @brief Dot product of two floats
     *
     */
    int j;
    double sum_ = 0.0;
    for (j = 0; j < N; j++)
        sum_ += mat1[j] * vec[j];
    return sum_;
}

void relu(double *vec, const int size)
{
    /**
     * @brief ReLU activation function f(x) = max(0, x)
     *
     */
    int i;
    for (i = 0; i < size ; i++)
        vec[i] = MAX(0, vec[i]);
}

